import React from 'react';
import { Grid } from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowLeftIcon from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import './SudokuGrid.css'; // Make sure to import your CSS file

const ComparisonSudokuCell = ({ cellData }) => {
  const { value, up, down, left, right } = cellData;

  return (
    <div className="sudoku-cell">
      <Grid container direction="column">
        <div className={`border-up ${up && 'active'}`}>
          {up && <KeyboardArrowUpIcon className="arrow-icon" />}
        </div>
        <Grid item container justifyContent="space-between">
          <div className={`border-left ${left && 'active'}`}>
            {left && <KeyboardArrowLeftIcon className="arrow-icon" />}
          </div>
          {value}
          <div className={`border-right ${right && 'active'}`}>
            {right && <KeyboardArrowRightIcon className="arrow-icon" />}
          </div>
        </Grid>
        <div className={`border-down ${down && 'active'}`}>
          {down && <KeyboardArrowDownIcon className="arrow-icon" />}
        </div>
      </Grid>
    </div>
  );
};

export default ComparisonSudokuCell;
